description:
Issues #7-12

Picking up right where Garth Ennis' epic 6-issue run left off! Jen's bloody war against the Blutes is over and it's time for the cleanup phase of the operation. All's well that ends well? In a word... no. Jen's enemies get a little too close, Jack gets a little too crazy, and it's all fun and games until someone loses an eye! How far is Jen really prepared to go to keep her revenge from wrecking her life, and what happens when the people she loves get in the way? 'If you dug on the messed-up first arc of Jennifer Blood, you should be very happy because the quality and insanity continues. Ewing comes on board and shows our titular heroine isn't just a one-trick pony. He doesn't try to replicate Ennis' run but instead builds gloriously up from it like an ambitious kid making a three story sandcastle with wi-fi and a car wash. The first arc was just the introduction, now we need to see Jennifer reap the blood she worked so hard to sew.

